import React,{Component} from 'react';
import TodoLabel from '../../src/componentes/biceLabel';

class BiceGraficas extends Component{
    constructor(props){
       super(props);
       //console.log(props.valor2)
       this.state={
           dato:props.valor2
        }
    };  

    render(){
         return(
             <div>
                {/* <input placeholder={this.props.valor2}/> */}
                <div className="card text-white bg-primary mb-12" >
                      <form action="/" method="get" >
                          <button className="btn btn-primary"type="submit">Volver</button>
                       </form>                
                </div>

                
             </div>
        )
    }


}
export default BiceGraficas;
